import React, { Component } from 'react';

class Dashboard extends Component {
    state = { emps: []}

    componentDidMount()
    {
        var data = [ 
        {No: 1, Name: "Mahesh", Address: "Pune"},
        {No: 2, Name: "Nilesh", Address: "Panji"},
        {No: 3, Name: "Amit", Address: "Chennai"}];

        console.log("Setting State to Array in Component Did Mount")
        this.setState({emps: data})
    }

    render() 
    {
        console.log("Inside render with emps size as " + this.state.emps.length );

        return (<table>
                   <thead>
                        <tr>
                            <th>No</th>
                            <th>Name</th>
                            <th>Address</th>
                        </tr>
                   </thead>
                   <tbody>
                        {
                        this.state.emps.map((emp)=>{
                            return <tr key={emp.No}>
                                <td>{emp.No}</td>
                                <td>{emp.Name}</td>
                                <td>{emp.Address}</td>
                            </tr>
                        })
                        }
                   </tbody>
                </table>);
    }
}

export default Dashboard;
